    "\n    query GetElectionStats(\n        $tenantId: uuid!\n        $electionEventId: uuid!\n        $electionId: uuid!\n        $startDate: String!\n        $endDate: String!\n        $electionAlias: String\n        $userTimezone: String!\n    ) {\n        stats: getElectionStats(\n            object: {\n                election_event_id: $electionEventId\n                election_id: $electionId\n                start_date: $startDate\n                end_date: $endDate\n                user_timezone: $userTimezone\n            }\n        ) {\n            total_distinct_voters\n            total_areas\n            votes_per_day {\n                day\n                day_count\n            }\n        }\n        users: count_users(\n            body: {\n                tenant_id: $tenantId\n                election_event_id: $electionEventId\n                election_id: $electionId\n                authorized_to_election_alias: $electionAlias\n            }\n        ) {\n            count\n        }\n        election: sequent_backend_election(\n            where: {\n                tenant_id: {_eq: $tenantId}\n                election_event_id: {_eq: $electionEventId}\n                id: {_eq: $electionId}\n            }\n        ) {\n            statistics\n        }\n    }\n": types.GetElectionStatsDocument,
